import React from 'react';
import home from './images/home.png';
import Rightfinderhome from '../Rightfinderhome/Rightfinderhome';
import Control from '../Control/Control';
import Leftfinder from '../Leftfinder/Leftfinder';
import alert from './images/alert.png';


const Home = () => {
    return(

        <div className='home'>
            {/* finder folder */}
            <div className='finderOpen'> 
                <div className='topFinder'>
                    <Control/>
                    <div className='icon'>
                        <img alt='' src={home}></img>
                        <div>Home</div>
                    </div>
                </div>
                <div className='bottomFinder'>
                   <Leftfinder Home={'#d7d6d6'} Docs={''}/>
                   <Rightfinderhome/>
                </div> 
                <div className='soonAlert'>
                    <div className='topAlert'>

                    </div>
                    <div className='bottomAlert'>
                        <img alt='' src={alert}></img>
                        <div>The document you are trying to access cannot be reached. Try accessing later after update has been completed.</div>
                    </div>
                 </div>
            </div>
            <div className='homeFolder'>
                <img alt='' src={home}></img>
                <div>Home</div>
            </div>
        </div>
    )
}

export default Home;
